    },
    {
      name: "Blake Lively",
      img: "img/top-chefs/img_6.jpeg",
      recipesCount: "09",
      cuisine: "French",
    },
  ];
  return (
    <div className="section chefs">
      <h1 className="title">Our Top Chefs</h1>
      <div className="top-chefs-container">
        <ChefCard />
